-- Table structure for `cmpc_metadatas`
-- ----------------------------
DROP TABLE IF EXISTS `cmpc_metadatas`;
CREATE TABLE `cmpc_metadatas` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(128) DEFAULT '' COMMENT '元素据名称(报文里面的名称和title区分开来)',
  `code` varchar(255) DEFAULT '' COMMENT '元数据code如(itemname)',
  `title` varchar(128) DEFAULT '' COMMENT 'title(界面里面显示出来的名称和name区分开来)',
  `type` tinyint(2) DEFAULT '0' COMMENT '元素据类型',
  `extend` text COMMENT '序列扩展参数-数据源(sql自定义输入的数据等-可无限扩展）自定义输入的数据用|符号隔开,type扩展等',
  `uid` int(11) DEFAULT '0' COMMENT '创建人ID',
  `create_time` int(10) DEFAULT '0' COMMENT '创建时间',
  `update_time` int(10) DEFAULT '0' COMMENT '更新时间',
  `order` int(10) DEFAULT '0' COMMENT '显示顺序，值越小显示越靠前',
  `desc` varchar(255) DEFAULT '' COMMENT '元数据描述',
  `data_value` text COMMENT '数据值',
  `data_type` tinyint(1) DEFAULT '0' COMMENT '0:自定义1:sql 数据类型',
  `is_auto_fill` tinyint(1) DEFAULT '0' COMMENT '是否自动填充文件名称 1:是 0:否',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='自定义元数据配置表';

